$(document).ready(function(){const n=$("#contact");let t="\n    <h1>Follow me at:</h1>\n    <ul>\n    ";$.ajax({url:"./../contact/contact.json",method:"GET"}).then(n=>{n.contacts.forEach(n=>{t+=`\n              <li class="noStyle">${n.icon} ${n.service} ${n.url}</li>\n              `}),t+="\n    </ul>\n    "}),n.html(t)});